import {Navbar, Container, Nav} from 'react-bootstrap';
import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import {Routes, Route, BrowserRouter} from 'react-router-dom'
import data from './data.js';
import Main from './routes/Main.js';
import Result from './routes/Result';
import Board from './routes/Board';
import List from './routes/List';
import {React, useState} from 'react';

function App() {

  const [newPost, setNewPost] = useState(null); // newPost 상태 정의

  return (
    <div className="App">
       <div className="black-nav">
      </div>
      <Navbar bg="dark" data-bs-theme="dark">
      <Container>
        <Navbar.Brand href="#">Home</Navbar.Brand>

      </Container>
</Navbar>

<List newPost={newPost} /> 
      <Routes>
      <Route path="/Main1/*" element={<Main/>} />
      <Route path='/result' element={<Result answers={Result.totalScore} />} />
      <Route path="/Board" element={<Board/>} />
      <Route path='/List' element={<List newPost={Board.newPost} />} />
      </Routes>
    {/* 라우터는 App.js에만 사용가능 */}
    </div>
  );
}




export default App;
